# import csv module to read and write to csv.
import csv
# import datetime module so I can add date to CSV file for water parameters.
import datetime
#import termcolor to manipulate color of text.
from termcolor import colored, cprint

# function to start the program over if user enters invalid choices.
def reset():
    print(colored("Invalid Choice", 'red'))
    start_over = input(colored("\nWould you like to start the program over? \nYes or No?" , 'green'))

    if start_over == "Yes":
        program_start()

    else:
        exit()


# create function to read the csv file containing water parameters.
def read_reef():

    reef = csv.reader(open("steve.csv", "r"))
    for row in reef:
        print(colored('{:<12} {:^10} {:^12} {:^10} {:^8} {:^8} {:^10} {:^10} {:^12} {:^10} {:^16} {:>10}'.format(*row),'blue'))

# function that will execute my program.
def program_start():
    # Welcome message that will explain options to the user.
    print(colored("Welcome to Steve's Reef Database!  A program designed to view information about different fish, coral and invertebrae."
      "\nYou can also use this program to log and track your water parameters! \n\nWhat would you like to do?\n\nPlease select a number: ",'blue'))

    print(colored("\n1: View Fish, 2: View Coral, 3: View Inverts, 4: Log Water Parameters, 5: View previous logs", 'yellow'))
    # Variable that will be used in If/Elif loops below.  Stores user input, executes program based on selection.
    choice = input()
    # If user choice is to view fish, execute for loop below.
    if choice == "1":
        for key in sorted(fish):
            print(colored(key, 'yellow'))
        print(colored("\nWhich fish would you like to view?", 'blue'))
        choice1 = input()
        if choice1 in fish:
            for key in sorted(fish[choice1]):
                print(colored(key, 'yellow'))
            print(colored("\nWhich "+ choice1 + " would you like to view?", 'blue'))
        else:
            reset()
        choice2 = input()
        if choice2 in fish[choice1]:
            for key in fish[choice1][choice2]:
                print(key,":",fish[choice1][choice2][key])
        else:
            reset()
    # If user choice is to view coral, execute for loop below.
    elif choice == "2":
       for key in sorted(coral):
          print(colored(key, 'yellow'))
       print(colored("\nWhich coral would you like to view?", 'blue'))
       choice1 = input()
       if choice1 in coral:
           for key in sorted(coral[choice1]):
               print(colored(key, 'yellow'))
           print(colored("\nWhich "+ choice1 + " would you like to view?", 'blue'))
       else:
           reset()
       choice2 = input()
       if choice2 in coral[choice1]:
            for key in coral[choice1][choice2]:
                print(key,":",coral[choice1][choice2][key])
       else:
           reset()
    # If user choice is to view inverts, execute for loop below.
    elif choice == "3":
       for key in sorted(inverts):
           print(colored(key, 'yellow'))
       print(colored("\nWhich invertebrae would you like to view?", 'blue'))
       choice1 = input()
       if choice1 in inverts:
           for key in sorted(inverts[choice1]):
               print(colored(key, 'yellow'))
           print(colored("\nWhich "+ choice1 + " would you like to view?", 'blue'))
       else:
           reset()
       choice2 = input()
       if choice2 in inverts[choice1]:
            for key in inverts[choice1][choice2]:
                print(key, ":",inverts[choice1][choice2][key])
       else:
           reset()
    # If user choice is to log water parameters, execute for loop below.
    elif choice == "4":
            def Parameters_input():
                Temperature = input("Enter Water Temperature:")
                Salinity = input("Enter Salinity Level:")
                PH_Balance = input("Enter PH Level:")
                Nitrate = input("Enter Nitrate Level:")
                Nitrite = input("Enter Nitrite Level:")
                Ammonia = input("Enter Ammonia Level:")
                Calcium = input("Enter Calcium Level:")
                Phosphate = input("Enter Phosphate Level:")
                Alkalinity = input("Enter Alkalinity Level:")
                Magnesium = input("Enter Magnesium Level:")
                Water_Change = input("Was the water changed? Enter Yes or No:")
                Date = datetime.date.today()
                return Temperature, Salinity, PH_Balance, Nitrate, Nitrite, Ammonia, Calcium, Phosphate, Alkalinity, Magnesium, Water_Change, str(Date)

            # Create empty list to store output from parameters input function.
            Parameters = []
            # Append the output from the parameters function to the list.
            Parameters.append(Parameters_input())
            # open the csv file, and set permission to append to the file.
            f = open("steve.csv", 'a')

            # for loop that will write values from Parameters list to csv file.
            for item in Parameters:
                f.write(str(item) + "\n")
    # If user enters 5 read csv file, and display results.
    elif choice == "5":
        # call the function to read the csv file.
        read_reef()
    # If user enters anything other than 1,2,3,4 or 5 return invalid and restart the program.
    else:
        reset()


# call the function to start the program.
program_start()

